import React from 'react'

import { AppPhoneIcon } from './Icons/AppPhoneIcon'

export const AppPhone = ({ phone }) => (
  <a href={ `tel:${ phone }` }>
    <AppPhoneIcon />
    { phone }
  </a>
)
